import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="bg">
        <span>
          <img className="upbeaticon" src="/images/upbeaticon.png" />
          <div className="headtext">UPBEAT</div>
        </span>
      </div>
    </div>
  );
}

export default App;
